import React, { Component } from "react";
import { Box, Button, Grommet } from "grommet";
import { FormClose, Notification } from "grommet-icons";

const theme = {
  global: {
    font: {
      family: "Roboto",
      size: "14px",
      height: "20px"
    }
  }
};

const AppBar = props => (
  <Box
    tag="header"
    direction="row"
    align="center"
    justify="between"
    background="brand"
    pad={{ left: "medium", right: "small", vertical: "small" }}
    elevation="medium"
    style={{ zIndex: "1" }}
    {...props}
  >
    <Button
      icon={<FormClose />}
      onClick={() => this.setState({ showSidebar: false })}
    />
  </Box>
);

class App extends Component {
  render() {
    return (
      <Grommet theme={theme}>
        <AppBar>Hello Grommet!</AppBar>
      </Grommet>
    );
  }
}

export default App;
